import React from 'react';

const Card = (props) => {
    return (
        <>
           <div className='Cardcmp'>
               <div classname='imgcard'>
                    <img src={props.src}/>
               </div>
               <div classname='details'>
               <h1>{props.title}</h1>
               </div>
           </div>
            
            

        </>
    );
}

export default Card;
